import React from "react";
import styled from "styled-components";

const Content = styled.div`
  background-color: #004aad;
  width: 100%;
  height: 100%;
`;

const Cards = styled.div`
  width: 25%;
  padding: 1rem;
`;

const Card = styled.div`
  margin: 1rem;
  color: white;
  text-align: center;
  padding: 1rem;
  border: white 2px solid;
  border-radius: 16px;
`;

const Paper = styled.div``;


const Desinger = () => {
  return (
    <Content>
      <Cards>
        <Card>Text</Card>
        <Card>Text</Card>
        <Card>Text</Card>
        <Card>Text</Card>
        <Card>Text</Card>
      </Cards>
    </Content>
  );
};

export default Desinger;
